import React, {Component} from 'react';

import './Moi.css';

class Moi extends Component {

  typeWriter(s) {
    let i = 0;
    setInterval(() => {
      document.querySelector('.type-writer').innerHtml += 's.charAt(i)';
      console.log("AHHH");
      i++;
      if(i ==  s.length) {
        clearInterval();
      }
    }, 100);

    /*for (var i = 0; i < s.length; i++) {
      document.querySelector('.type-writer').innerHtml += s.charAt(i);
      sleep(2);
    }*/
  }

  componentDidMount() {
    this.typeWriter("Moi svpidjpsjovpo jpojspfojspdfoj");
  }

  render() {
    return (<div id="moi">
      <h1 className="type-writer title"></h1>
    </div>);
  }
}

export default Moi;
